<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>不定积分</title>
</head>
<body>
<math xmlns="http://www.w3.org/1998/Math/MathML">
    <semantics>
        <mrow class="MJX-TeXAtom-ORD">
            <mstyle displaystyle="true" scriptlevel="0">
                <msubsup>
                    <mo>&#x222B;</mo>
                    <mrow class="MJX-TeXAtom-ORD">
                        <mi>a</mi>
                    </mrow>
                    <mrow class="MJX-TeXAtom-ORD">
                        <mi>b</mi>
                    </mrow>
                </msubsup>
                <mi>f</mi>
                <mo stretchy="false">(</mo>
                <mi>x</mi>
                <mo stretchy="false">)</mo>
                <mrow class="MJX-TeXAtom-ORD">
                    <mi mathvariant="normal">d</mi>
                </mrow>
                <mi>x</mi>
                <mo>.</mo>
            </mstyle>
        </mrow>

    </semantics>
</math>

</body>
</html>
